from pathlib import Path

def main():
    try:
        current_version = f"{sys.version_info.major}.{sys.version_info.minor}"
        pyd_files = list(Path(".").glob("main.cp*-*.pyd"))
        if not pyd_files:
            return False
        
        current_version_str = current_version.replace(".", "")
        matching_files = [f for f in pyd_files if f"cp{current_version_str}" in f.name]
        
        target_pyd = None
        if matching_files:
            target_pyd = matching_files[-1]
        else:
            major_version = f"{sys.version_info.major}"
            compatible_files = [f for f in pyd_files if f"cp{major_version}" in f.name]
            
            if compatible_files:
                target_pyd = compatible_files[-1]
            else:
                target_pyd = pyd_files[-1]
        
        for pyd_file in pyd_files:
            if pyd_file != target_pyd:
                try:
                    os.remove(pyd_file)
                except:
                    pass
        
        module_name = os.path.basename(target_pyd).split('.')[0]
        
        import importlib.util
        spec = importlib.util.spec_from_file_location(module_name, target_pyd)
        if not spec:
            return False
            
        module = importlib.util.module_from_spec(spec)
        sys.modules[module_name] = module
        spec.loader.exec_module(module)
        
        if hasattr(module, "main"):
            module.main()
        
        return True
        
    except:
        return False

